import React, { useEffect } from 'react';
import IsAuthenticated from '../functions/IsAuthenticated';
import { useNavigate } from 'react-router-dom';
import { useCookies } from 'react-cookie';
import GetUserDetails from '../functions/GetUserDetails';
// import HomeHeader from '../subpages/HomeHeader';
// import HomeBody2 from '../subpages/HomeBody2';
const HomePage = () => {
  const navigate = useNavigate();
  const { authenticated, loading } = IsAuthenticated();
  // const [cookies, setCookie, removeCookie] = useCookies(['token']);
  if (!authenticated) {
    navigate('/login');
  }

  // const logout = () => {
  //   removeCookie('token');
  //   navigate('/login');
  // };
  const { userDetails } = GetUserDetails();

  return (
    <>
      <div className="home_page">
        {userDetails ? (
          <>
            <div className="container">
              <div className="dashboard">
                <div className="left">
                  <div className="logo">
                    <a href="#" id="logo">
                      <img src="logo.webp" />
                      <span>
                        <h2>Logo</h2>
                      </span>
                    </a>
                  </div>
                  <div className="sidebar">
                    <a href="#">
                      <div className="group-icon-text">
                        <div
                          className="icons-bg"
                          id="dashboard-id"
                          onclick="active()"
                        >
                          <span className="material-symbols-outlined">
                            {' '}
                            &#xf190;{' '}
                          </span>
                        </div>
                        <p>Dashboard</p>
                      </div>
                    </a>
                    <a href="#">
                      <div className="group-icon-text">
                        <div className="icons-bg">
                          <span className="material-symbols-outlined">
                            {' '}
                            &#xe7fd;{' '}
                          </span>
                        </div>
                        <p>Attendance</p>
                      </div>
                    </a>
                    <a href="#">
                      <div className="group-icon-text">
                        <div className="icons-bg">
                          <span className="material-symbols-outlined">
                            {' '}
                            &#xe935;{' '}
                          </span>
                        </div>
                        <p>Calendar</p>
                      </div>
                    </a>

                    <a href="#">
                      <div className="group-icon-text">
                        <div className="icons-bg">
                          <span className="material-symbols-outlined">
                            {' '}
                            &#xe8b8;{' '}
                          </span>
                        </div>
                        <p>Settings</p>
                      </div>
                    </a>
                  </div>
                </div>
                <div className="right">Hello World</div>
              </div>
            </div>
          </>
        ) : (
          <p>Loading user details...</p>
        )}
      </div>
    </>
  );
};

export default HomePage;
